let state = {
    dialogsPage: {
         dialogsData: [
            {id: 1, ava:"https://cdn.fishki.net/upload/post/2016/08/25/2053779/ca55c2b419c16b42ce6bcc274cc72ad6.png", name: "Dimych",},
            {id: 2, ava:'https://cdn.fishki.net/upload/post/2016/08/25/2053779/ca55c2b419c16b42ce6bcc274cc72ad6.png', name: "Evgeniy",},
            {id: 3, ava:'https://cdn.fishki.net/upload/post/2016/08/25/2053779/ca55c2b419c16b42ce6bcc274cc72ad6.png', name: "Sasha",},
        ],
        messagesData: [
            {id: 1, message: "Hello",},
            {id: 2, message: "How are you?",},
            {id: 3, message: "Chel",},
        ],
    },
    profilePage: {
        postsData: [
            {name: 'Evgeniy', text: 'I need more React', like:'16'},
            {text: 'I love REACT!!!', like:'45'},
        ],
    },

    friendsPage: {
        friendsData: [
            {username: 'Evgeniy1'},
            {username: 'Evgeniy2'},
            {username: 'Evgeniy3'},
        ],
    },
};

export default state;
